import React, { Component } from 'react';
import "./waniwani.css";
import iwakabe from './image/iwakabe.jpg';


export default class Cooking extends Component  {
    constructor (props) {
        super(props);
        this.state = {
            timing:"",
            Image:"",
            Name:"",
            Ans:"",
            level:"easy"
        };
    }

    MakeGate = () =>{
        return(
        <div className="Gate">
        <table className="test">
            <tbody>
                <tr>
                    <td><img src={iwakabe} height="30px" width="30px"/></td>
                    <td><img src={iwakabe} height="30px" width="30px"/></td>
                    <td><img src={iwakabe} height="30px" width="30px"/></td>
                    <td><img src={iwakabe} height="30px" width="30px"/></td>
                    <td><img src={iwakabe} height="30px" width="30px"/></td>
                </tr>
                <tr>
                <td><img src={iwakabe} height="30px" width="30px"/></td>
                    <td></td>
                    <td></td>
                    <td></td>
                    <td><img src={iwakabe} height="30px" width="30px"/></td>
                </tr>
                <tr>
                <td><img src={iwakabe} height="30px" width="30px"/></td>
                    <td></td>
                    <td></td>
                    <td></td>
                    <td><img src={iwakabe} height="30px" width="30px"/></td>
                </tr>
                <tr>
                <td><img src={iwakabe} height="30px" width="30px"/></td>
                    <td></td>
                    <td></td>
                    <td></td>
                    <td><img src={iwakabe} height="30px" width="30px"/></td>
                </tr>
            </tbody>
        </table>
    </div>
        );
    }


    HitWani = () =>{
        console.log("hit wani")
    }

    ClickStart = () =>{
        this.intervalId = setInterval(()=>{
            this.rand_WaniUp();
        }, 1000);
    }
    
    rand_MoguraUp = () =>{
        const {location} = this.state;
        const {time} = this.state;
        var img = document.getElementById(location);
        img.src = shibafu;

        var a = Math.floor( Math.random() * 25)+1 ;
        console.log(a);

        const IdNum = "Mas" + a;
        this.setState({
            location:IdNum
        })

        var Next_img = document.getElementById(IdNum);
        Next_img.src = mogura;

        this.setState({
            time:time - 1
        })
    }

    render() {
        const {btn} = this.state;
        return (<div>
            <div className="Header">
                <h1>ワニワニパニック</h1>
                <h3>誰が出てくるかな？ 当ててみて</h3>
                <a>レベル: </a>
                <select name="level" onChange={(e) => this.setState({level:e.target.value})}>
                    <option value="easy"  >簡単</option>
                    <option value="nomal" >普通</option>
                    <option value="difficult">難しい</option>
                </select>
                <input type="button" id="StButton"　className="StButton" value="スタート" onClick={this.ClickStart}></input><br/>
            </div>
            <div>
                {this.MakeGate()}
                {this.MakeGate()}
                {this.MakeGate()}
                {this.MakeGate()}
                {this.MakeGate()}
            </div>
            {
                (() =>{

                })()

            }
            <div className="WaniWani1"  onClick={this.HitWani}></div>
            <div className="WaniWani2"  onClick={this.HitWani}></div>
            <div className="borderline"></div>
            
        </div>);
    }
  }
